import TMDB from '../TMDB'

import FilmRow from "./FilmRow"
import React, { Component } from 'react'

export const FilmListing = (element) => {
    const allFilms = element.map(ele => {
        return <FilmRow element={element} key={element.id}/>
      });

      return(
          <div>
              {allFilms}
          </div>
      )
}
